import logo from './logo.svg';
import './App.css';

import {Produktet} from './Produktet';
import {Personat} from './personat';
import {kompania} from './kompania';
import {Navigation} from './Navigation';

import {BrowserRouter, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className="container">
     <h3 className="m-3 d-flex justify-content-center">
       React JS Tutorial
     </h3>

     <Navigation/>

     <Switch>
       <Route path='/' component={Produktet} exact/>
       <Route path='/personat' component={Personat}/>
       <Route path='/kompania' component={Kompania}/>
     </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
